import React from 'react';
import MicroCard from "./MicroCard";

const FollowersColumn = (topFiveFollowing) => {
    console.log("IN");console.log(topFiveFollowing);
    let users = Object.entries(Object.entries(topFiveFollowing.users)).topFiveFollowing;
    console.log("FollowersColumn");console.log(users);

    return (

        <div className="followers-column">
            <div className="followers-section">
                <div className="home" />
                <h2 className="bold red">For You</h2>
            </div>
            <div className="followers-section">
                <div className="following" />
                <h2>Following</h2>
            </div>
            <hr />
                <p>Your top accounts</p>
                {users && users.map((user, index) => (
                    <MicroCard
                        key={index} user={user}
                    />
                ))}
            <hr />
        </div>

    );

  }

  export default FollowersColumn;
